(1,	'',	'Goldman Sachs and Abu Dhabi’s Mubadala ink $1 billion partnership to invest in Asia Pacific ',	'<p>DUBAI, United Arab Emirates — Goldman Sachs and Abu Dhabi sovereign wealth fund Mubadala on Monday signed a $1 billion private credit partnership to co-invest in the Asia-Pacific region, with a particular focus on India, the institutions said in a joint statement.</p><p>The separately managed account, termed the “Partnership,” will be managed by Private Credit at Goldman Sachs Alternatives, with a staff based on the ground in various markets across the region. It will invest the long-term capital in “high quality companies ... across the private credit spectrum” across a number of Asia-Pacific markets.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>The news follows Goldman’s 2023 expansion in the Middle East with the opening of its office in Abu Dhabi Global Market, the financial center of the United Arab Emirates capital.</p><p>It also comes as the UAE and other Gulf states increase their economic footprint in India, which is set to be the fastest-growing G20 economy for the 2023-24 fiscal year. The <a href=\"https://www.thehindu.com/business/Economy/uae-emerges-as-fourth-largest-investor-in-india-in-fy-23/article66957403.ece\" target=\"_blank\">UAE in October 2023 announced a target to invest $75 billion</a> in India over a period of time, while Saudi Arabia set an investment target in the country of $100 billion.</p><p><strong>″</strong>India, in particular, stands out as a key market with significant opportunities in private credit, and where Goldman Sachs has strong exposure and capabilities,” said Fabrizio Bocciardi, Mubadala’s head of credit investments, in a press release.</p><br /><p>“The opportunity in private credit in Asia Pacific is expansive,” Greg Olafson, global head of private credit at Goldman Sachs Alternatives, said. “With strong economic growth in the region and favorable conditions for private lenders to support the growth of leading companies by providing flexible, long-term capital, we believe we are at the early stages of a defining era for private credit in Asia Pacific.”</p><p>He said the partnership with Mubadala will enable the bank to expand its “long-established investment focus on the region.”</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Omar Eraiqat, Mubadala’s deputy CEO of diversified investments, said that the Goldman Sachs partnership “compliments our aspirations to grow our private credit exposure in APAC, a region that is central to Mubadala’s strategic growth initiatives.”</p><p>Mubadala Investment Company manages a global portfolio of $276 billion spanning six continents and a range of sectors and asset classes, according to the firm, with a focus on diversification of the UAE economy.</p>',	'2024-02-26 16:00:22.997',	NULL,	'https://image.cnbcfm.com/api/v1/image/106909052-1625859613739-gettyimages-1173254470-UAE_DHABI.jpeg?v=1708957103&w=929&h=523&vtcrop=y',	'US',	'Goldman Sachs and Abu Dhabi’s Mubadala ink $1 billion partnership to invest in Asia Pacific '),
(2,	'',	'Mauritius blocks Norwegian cruise ship over fears of a potential cholera outbreak',	'<p>A Norwegian cruise ship has been denied permission to dock in Mauritius over fears of a potential cholera outbreak on board. </p><p>Local authorities on Sunday denied permission for the Norwegian Dawn vessel, which has 2,184 passengers and 1,026 crew on board, to access the Mauritius capital of Port Louis, <a href=\"http://www.mauport.com/communique\" target=\"_blank\">citing</a> “potential health risks.”</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>The ship was on a 12-day itinerary from Cape Town, South Africa to Port Louis that started on Feb. 13.</p><p>The Mauritius Ports Authority said Sunday that samples were taken from at least 15 passengers on board. These passengers had been placed in isolation on board the vessel “due to the state of their health,” the port authority said, according to a Google translation. </p><p>“As the test results will only be known in approximately 48 hours, passengers who were due to board the ‘Norwegian Dawn’ and begin their cruise from Mauritius today will not be able to do so due to potential health risks. They will have to be relocated to available hotel establishments,” the port authority said.</p><p>A spokesperson for the U.S.-headquartered <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-2\"><a href=\"/quotes/NCLH/\">Norwegian Cruise Line Holdings</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> said Sunday that “a small number of guests experienced mild symptoms of a stomach-related illness” during Norwegian Dawn’s South Africa voyage. </p><p>On returning to Port Louis, the spokesperson said the vessel’s management team met with local authorities to confirm that precautionary measures were being taken to ensure the wellbeing of those on board.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Multiple media outlets <a href=\"https://www.usatoday.com/story/travel/cruises/2024/02/25/norwegian-dawn-quarantine-cholera/72737444007/?tbref=hp\" target=\"_blank\">reported</a> the stomach illness on board the ship was suspected to be cholera.</p><p>“The health and safety of our guests, crew and the destinations we visit is our top priority. We operate at the highest public health and sanitation standards, and encourage our guests to practice good hygiene and to report any illness-related symptoms to the onboard medical team immediately,” the spokesperson for Norwegian Cruise Line Holdings said. </p><p>“Additionally, we have elevated our sanitation procedures aboard the ship as part of our routine measures to ensure a safe environment for all on board and will continue to take any necessary measures to protect our guests, crew and destinations we visit,” they added.</p><br /><p>The World Health Organization <a href=\"https://www.who.int/news-room/fact-sheets/detail/cholera\" target=\"_blank\">says</a> cholera is an “extremely virulent” disease transmitted through the ingestion of contaminated food or water. </p><p><a href=\"https://www.cdc.gov/cholera/general/index.html#four\" target=\"_blank\">It is rare in the U.S.</a>, and infection is often mild or without symptoms, but the Centers for Disease Control and Prevention has warned that symptoms can also be severe. The CDC says cholera symptoms can include diarrhea, vomiting and leg cramps. </p><p>Since January last year, the U.N. <a href=\"https://reliefweb.int/report/malawi/southern-africa-cholera-situation-snapshot-28-january-2024#:~:text=This%20includes%20six%20countries%20currently,the%20highest%20in%20the%20region.\" target=\"_blank\">says</a> that roughly 188,000 cholera cases have been reported across eight southern African countries, including 3,000 related deaths.</p>',	'2024-02-26 16:00:23.010',	NULL,	'https://image.cnbcfm.com/api/v1/image/107378121-1708946893009-gettyimages-1571765376-dsc_5911_lsvinnms.jpeg?v=1708946957&w=929&h=523&vtcrop=y',	'US',	'Mauritius blocks Norwegian cruise ship over fears of a potential cholera outbreak'),
(3,	'',	'Chinese tech firm Lenovo shows off a laptop with a see-through screen',	'<p>Chinese tech giant <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-1\"><a href=\"/quotes/992-HK/\">Lenovo</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> showed off a prototype laptop on Monday that has a see-through screen, underscoring how the world’s largest PC maker is trying to innovate after a brutal couple of years for the market.</p><p>The laptop is equipped with a trackpad which features a touch keyboard and a stylus to draw or navigate with.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>The obvious question is: Why would you want this kind of device? Lenovo showed off some of its capabilities.</p><p>A representative who ran a demonstration for CNBC placed an artificial sunflower behind the screen. The camera built into the laptop was able to identify the object as a sunflower then provide information about it, using artificial intelligence technology.</p><br /><p>Another use, the representative said, is in a construction scenario. For example, if an architect is designing an extension on a house, they could see the house through the screen, and use the stylus to draw their design to envisage what it may look like.</p><p>Like all new technology, there may often be uses not yet imagined.</p><br /><p>The technology is similar to augmented reality in some senses. AR, which has been <a href=\"#\">popularized by glasses</a> or headsets like <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-3\"><a href=\"/quotes/AAPL/\">Apple’s</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> <a href=\"https://www.cnbc.com/2024/01/30/apple-vision-pro-review-the-future-of-computing-and-entertainment.html\">Vision Pro</a>, is when digital content is superimposed on the real-world you see in front of you.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Since the laptop is a concept product, Lenovo has no plans to sell the device.</p><p>However, PC makers are looking toward the future after a difficult couple of years. PC sales spiked during the height of the Covid-19 pandemic, but as people returned to work, they began to plunge. Last year, PC shipments fell nearly 15% year-on-year, <a href=\"https://www.gartner.com/en/newsroom/press-releases/01-10-2024-gartner-says-worldwide-pc-shipments-increased-zero-point-three-percent-in-fourth-quarter-of-2023-but-declined-fourteen-point-eight-percent-for-the-year\" target=\"_blank\">according to Gartner.</a></p><br /><p>The Chinese tech giant showed off the device at Mobile World Congress in Barcelona, the world’s biggest mobile industry trade show.</p><p>Lenovo does have a history of teasing concept devices to prove its ability to innovate. Last year at MWC, <a href=\"https://www.cnbc.com/2023/02/28/motorola-shows-off-a-rollable-smartphone-with-a-screen-that-extends.html\">Lenovo displayed a smartphone that had a screen that rolls up</a>.</p>',	'2024-02-26 16:00:23.018',	NULL,	'https://image.cnbcfm.com/api/v1/image/107377936-1708794513442-Lenovo_Transparent_Laptop_Main_Pic.jpg?v=1708794929&w=929&h=523&vtcrop=y',	'US',	'Chinese tech firm Lenovo shows off a laptop with a see-through screen'),
(4,	'',	'Samsung debuts a ‘smart ring’ with health-tracking features — its first foray into the product category',	'<p>BARCELONA, Spain — Samsung’s Galaxy Ring, its latest wearable, is launching with health-tracking features including heart rate and sleep monitoring while also giving users a score of their readiness for the day, a top executive told CNBC.</p><p>In a wide-ranging interview, Hon Pak, head of the digital health team at Samsung Electronics, discussed the company’s first foray into the product category of rings, considerations for a subscription model for the Samsung Health app and his vision for an artificial intelligence “coach.”</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Samsung teased the Galaxy Ring in January during the news conference when it <a href=\"https://www.cnbc.com/2024/01/17/samsung-galaxy-s24-specs-price-availability-ai-features.html\">launched the S24 smartphone</a>. The South Korean tech giant is putting it on display for the first time at the Mobile World Congress in Barcelona, which kicks off Monday.</p><br /><p>Pak said the ring, which is fitted with sensors, will be able to give readings on heart rate, respiratory rate, the amount of movement made during sleep and the time it takes a person to fall asleep once in bed.</p><br /><p>He also said the ring will be able to give a user a “vitality score” which “collects data about physical and mental readiness to see how productive you can be.”</p><p>All of that will be accessible through the Samsung Health app.</p><p>The ring is set to go on sale this year, but Pak did not give a timeline or the pricing.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Pak also said the company is considering adding a feature that would allow the Galaxy Ring to do contactless payments, as with smartphones.</p><p>“We have a whole ... team that is looking at that. But I think clearly looking at multiple different use cases for the Ring beyond just health, for sure,” Pak said.</p><p>The Samsung executive also said the company is working on noninvasive glucose monitoring as well as blood pressure sensing through its wearable devices.</p><p>“I think we have some ways to go,” Pak said of noninvasive glucose monitoring. Currently, people use devices that pierce the skin to check glucose levels. A noninvasive way to do that would be a huge step.</p><br /><p>Samsung is hoping that various devices will boost its positioning in health, an area it has been working on for several years.</p><p>The company has its smartphones and smartwatches. The Galaxy Ring is the newest product category in health. Samsung said the decision to launch a “smart ring” was driven by its customers.</p><p>“Our own customers told us, I want choice. I want the ability to have other forms of wearables to measure health,” Pak said. “And some want to wear the watch, some want to wear the watch and the ring and get benefit from both. Some just want more simplicity.”</p><br /><p>Pak confirmed that when the smartwatch and Ring are worn together, users will be able to get different health insights.</p><p>Samsung is not the first company to launch smart rings. There are a handful of other players such as Oura.</p><p>Previous generations of Samsung’s flagship smartphone, such as the S7, have sensors that track things like heart rate. Users could put their finger on the sensor and it would give a reading. Samsung has done away with those sensors on its phones, especially since it has smartwatches that offer these features.</p><p>However, Pak did not rule out the possibility that future smartphones would have health sensors on them.</p><p>“Mobile is still very pervasive and so I think there are reasons why we may want to put a sensor on a mobile versus having it on a wearable,” Pak said.</p><br /><p>Pak discussed how artificial intelligence will play a role in Samsung’s health services. AI can help make sense of all of the data these devices are collecting. And ultimately, Pak’s goal is to get the AI to give deeper insights into a person’s health.</p><p>He said large language models, which are AI models trained on huge amounts of data and that underpin applications like chatbots, can help to give greater insights.</p><p>“Imagine that large language model, acting as my digital assistant, while looking at the context of my medical records, my physiological data, my engagement with a mobile device, the wearables during all of that ... begins to bring greater insights and personalization opportunities,” Pak said.</p><p>“There’s a digital assistant coach in the future, because we think that’s absolutely needed,” the Samsung executive said.</p><p>Pak described a scenario in which a digital assistant offers health advice in the right tone and context, saying “our ability to change our behavior becomes much greater.”</p><p>Bixby, Samsung’s digital assistant, could have a part to play, Pak said.</p><p>“So we are exploring various different ways in which the human computer interface will change over time. ... And so we think Bixby with speech represents a significant part of that option. But we don’t think it’s the only option. But Bixby potentially combined with large language models can be a phenomenal game changer. And we’re obviously having that conversation,” Pak said.</p><p>The executive also said the company is “considering” a subscription service for its Samsung Health app, but that the capabilities and insights it offers need to be improved before that can happen. AI assistants can help.</p><p>“If you’re going to really make me pay for something, you better give me something that’s more end to end that’s more comprehensive” in terms of health insights, Pak said.</p>',	'2024-02-26 16:00:23.022',	NULL,	'https://image.cnbcfm.com/api/v1/image/107377989-1708891073994-Samsung_Galaxy_Ring_5.jpg?v=1708891273&w=929&h=523&vtcrop=y',	'US',	'Samsung debuts a ‘smart ring’ with health-tracking features — its first foray into the product category'),
(5,	'',	'Billionaire-backed Koch network halts Nikki Haley campaign funding after South Carolina loss',	'<p><a href=\"https://www.cnbc.com/2023/11/28/billionaire-backed-koch-network-endorses-nikki-haley-for-president.html\">Americans for Prosperity Action</a>, the network backed by billionaire&nbsp;<a href=\"https://www.cnbc.com/charles-koch/\">Charles Koch</a>, is pausing its financial support of Republican presidential candidate Nikki Haley’s campaign a day after she lost to former President <a href=\"https://www.cnbc.com/2024/02/24/south-carolina-gop-primary-nikki-haley-and-donald-trump-face-off.html\">Donald Trump</a> in her home-state primary in South Carolina.</p><p>AFP Action said it still endorses Haley for president but now its support will only come in the form of words — not cash.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>“Given the challenges in the primary states ahead, we don’t believe any outside group can make a material difference to widen her path to victory,” AFP Action CEO Emily Seidel wrote in an email to staff, first reported by Politico. “And so while we will continue to endorse her, we will focus our resources where we can make the difference.”</p><p>AFP Action declined to provide further comment beyond the staff memo.</p><p>AFP Action closing its wallet is the next nail in the coffin for the former South Carolina governor who has taken a series of hits since the start of the election year. Along with AFP Action, billionaire <a href=\"https://www.cnbc.com/2024/01/24/source-reid-hoffman-pauses-haley-funding-after-new-hampshire-loss.html\">Reid Hoffman</a> has also stopped funding Haley’s presidential bid.</p><br /><div class=\"RelatedContent-relatedContent\" id=\"RegularArticle-RelatedContent-1\"><div class=\"RelatedContent-container\"><div class=\"RelatedContent-nonCollapsibleContent\"><h2 class=\"RelatedContent-header\">Read more CNBC politics coverage</h2><div class=\"group\"><ul><li><a href=\"https://www.cnbc.com/politics/#:~:text=White%20House%20to%20expand%20Russia%20sanctions%20over%20Alexei%20Navalny%E2%80%99s%20death\"><strong>White House to expand Russia sanctions over Alexei Navalny’s death</strong></a></li><li><a href=\"https://www.cnbc.com/2024/02/20/appeals-court-to-rehear-nasdaq-diversity-rule-challenge.html\"><strong>Appeals court will rehear challenge to Nasdaq board diversity rule, putting mandate at risk</strong></a></li><li><a href=\"https://www.cnbc.com/2024/02/06/new-senate-bill-aims-to-kill-proposed-sec-rule-on-ai-conflicts-of-interest-.html\"><strong>Senate bill aims to kill proposed SEC rule on AI conflicts of interest</strong></a></li></ul></div></div></div></div><br /><p>Despite the setbacks, Haley has <a href=\"https://www.cnbc.com/2024/02/20/nikki-haley-vows-to-stay-in-2024-race-after-raising-16point5-million-in-january-.html\">pledged</a> to stay in the race through Super Tuesday on March 5. Her campaign said AFP Action pulling funding has not changed that calculus and that it still has the resources to stay afloat.</p><p>“AFP is a great organization and ally in the fight for freedom and conservative government. We thank them for their tremendous help in this race,” Haley’s campaign said in a statement Sunday. “Our fight continues, and with more than $1 million coming in from grassroots conservatives in just the last 24 hours, we have plenty of fuel to keep going. We have a country to save.”</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>AFP Action will instead channel its resources to finance Republican campaigns on the congressional level. It has so far endorsed five candidates running for Senate and 19 candidates running for House seats.</p><p>“With the South Carolina presidential primary this weekend and the Senate engagement really heating up,” Seidel wrote in the email. “It’s time to take stock of where we are and – as we always do – make sure we’re optimizing our resources.”</p><p><em><strong>Don’t miss these stories from CNBC PRO:</strong></em></p><ul><li><a href=\"https://www.cnbc.com/2024/02/25/berkshire-hathaway-is-one-of-the-most-overbought-stocks-on-wall-street-here-are-the-others.html\"><em>Berkshire Hathaway is one of the most overbought stocks on Wall Street. Here are the others</em></a></li><li><a href=\"https://www.cnbc.com/2024/02/23/want-a-nvda-alternative-6-chip-suppliers-look-set-to-benefit-from-ai-boom.html\"><em>Want a Nvidia alternative? These 6 chip suppliers look set to gain big from the AI boom</em></a></li><li><a href=\"https://www.cnbc.com/2024/02/22/jefferies-says-buy-this-little-known-software-stock-with-ties-to-nvidia.html\"><em>Jefferies says buy this under-the-radar software stock with ties to Nvidia and nearly 20% upside</em></a></li><li><a href=\"https://www.cnbc.com/2024/02/21/opportune-time-to-invest-in-real-estate-pros-name-5-reits-to-buy-right-now.html\"><em>‘Opportune time to invest in real estate’: Pros name 5 REITs to buy right now</em></a></li></ul>',	'2024-02-26 16:00:23.025',	NULL,	'https://image.cnbcfm.com/api/v1/image/107375763-17084560432024-02-20t181806z_1617585162_rc2g66axuflz_rtrmadp_0_usa-election-haley.jpeg?v=1708456104&w=929&h=523&vtcrop=y',	'US',	'Billionaire-backed Koch network halts Nikki Haley campaign funding after South Carolina loss'),
(6,	'',	'China opposes U.S. sanctions on Chinese companies for Russia-related reasons',	'<p>China&nbsp;firmly&nbsp;opposes&nbsp;the United States imposing&nbsp;sanctions&nbsp;on&nbsp;Chinese&nbsp;enterprises for Russia-related&nbsp;reasons, the&nbsp;Chinese&nbsp;commerce ministry said on Monday.</p><p>China&nbsp;will take necessary measures to firmly safeguard the legitimate rights and interests of&nbsp;Chinese&nbsp;enterprises, the ministry said in a statement on its website.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>The Biden administration on Friday&nbsp;<a href=\"https://www.reuters.com/world/us-places-export-restrictions-93-entities-russia-china-uae-turkey-others-2024-02-23/\" target=\"_blank\">announced</a>&nbsp;new trade restrictions on 93 entities from Russia,&nbsp;China, Turkey, the United Arab Emirates, Kyrgyzstan, India and South Korea for supporting Russia’s war effort in Ukraine.</p><p>The action, one day before the second anniversary of Russia’s invasion of Ukraine, essentially bans U.S. shipments to the targeted entities, including eight from&nbsp;China, 63 from Russia, 16 from Turkey and four from the UAE.</p>',	'2024-02-26 16:00:23.028',	NULL,	'https://image.cnbcfm.com/api/v1/image/107378077-1708935189206-gettyimages-151255080-71173246.jpeg?v=1708935231&w=929&h=523&vtcrop=y',	'US',	'China opposes U.S. sanctions on Chinese companies for Russia-related reasons'),
(7,	'',	'Economic boost from Taylor Swift’s Eras Tour could be overstated, Nomura warns',	'<p>The devil’s in the details, but local economies have a friend in Taylor Swift.</p><p>The American pop star has spent nearly a year crossing the U.S. and the globe with her high-flying Eras Tour. The economic effect of the “Karma” singer’s show has caught the attention of everyone from the <a href=\"https://www.nbcnews.com/business/consumer/taylor-swift-federal-reserve-credits-eras-tour-boosting-hotels-tourism-rcna94046\" target=\"_blank\">Federal Reserve</a> to <a href=\"https://www.cnbc.com/2023/09/08/taylor-swift-is-single-handedly-giving-a-boost-to-hotel-industry-revenue.html\">Wall Street</a>.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Her tour undoubtedly helped the local economies she visited, according to a new report out from Japanese investment bank Nomura. But the firm questions how much of an imprint it made on national data.</p><p>“Her boost to consumption has certainly enchanted US economic analysts, but we believe the total macroeconomic effect is probably overstated,” Nomura global economist Si Ying Toh wrote to clients last week.</p><p>Between the first and third quarter of 2023, Swift’s venture alone lifted nominal U.S. retail sales by 0.03%, and real gross domestic product, a measure of economic output, by 0.02%, Nomura estimates show.</p><p>For all of 2023, the 14-time Grammy winner’s tour accounted for 0.5% of nominal consumption growth, according to the firm’s calculations.</p><p>Though those data points can be considered marginal, Toh said the economic boost — which some have dubbed the “Swift-lift” — is “undeniable” for the 20 cities U.S. she visited.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Stops on The Eras Tour saw a bump of 2.1 percentage points to lodging inflation during the month of Swift’s visit, according to STR data cited by Toh. Data from hotel booking platform Trivago shows a similar rise, she added.</p><p>Looking at Chicago specifically, Toh estimated that lodging prices rose 3.1 percentage points due to Swift’s three shows there. The city, which is the third-most populated in the U.S., saw a bump of 8.1 percentage points in occupancy and a 59% increase in hotel revenue per available room during Swift’s stint.</p><p>From that, the consumer price index for the Illinois city increased 0.5 percentage points from the singer’s visit alone. CPI is the measure of a basket of goods and services used to calculate changes in costs over time.</p><p>It’s less likely for these local improvements to materialize in national-level statistics from larger economies such as the U.S., U.K. or Japan, Toh said. Still, these events are worth watching as potential economic catalysts in countries around the globe, she said.</p><p>Internationally, small economies such as Singapore and Sweden could see the biggest macro boosts from her tour, according to Toh.</p><p>“Exogenous shocks play a key role in economic modeling, whether in the form of an extreme weather event, a pandemic or … a pop concert,” Toh wrote to clients. “In recent years, concert tours have grown to become not just major social phenomena but also potentially a significant driver of economic activity.”</p><p>Swift’s tour is set to conclude near the end of 2024. The film version, which already captured <a href=\"https://www.cnbc.com/2023/11/03/taylor-swift-eras-tour-movie-takes-final-bow-at-box-office.html#:~:text=The%20Eras%20Tour%20film%20has,It%22%20concert%20documentary\'s%20global%20haul.\">more than $200 million globally</a> through a movie theater run, begins <a href=\"https://www.cnbc.com/2024/02/07/taylor-swift-eras-tour-film-to-stream-on-disney-in-march.html\">streaming on Disney+</a> on March 15.</p><p><em><strong>Don’t miss these stories from CNBC PRO:</strong></em></p><ul><li><a href=\"https://www.cnbc.com/2024/02/18/buffetts-berkshire-keeps-new-stock-pick-secret-again-what-it-means.html\"><em>Warren Buffett’s Berkshire keeps new stock pick secret — again. Here’s what it means</em></a></li><li><a href=\"https://www.cnbc.com/2024/02/14/michael-burry-of-the-big-short-fame-buys-amazon-alphabet-and-a-dozen-of-other-new-stocks.html\"><em>Michael Burry of ‘The Big Short’ fame buys Amazon, Alphabet and a dozen other new stocks</em></a></li><li><a href=\"https://www.cnbc.com/2024/02/15/move-over-nvidia-a-new-hot-ai-play-has-soared-950percent-in-the-past-year.html\"><em>Move over, Nvidia. There’s a new hot AI play that has soared 960% in the past year</em></a></li><li><a href=\"https://www.cnbc.com/2024/02/19/morgan-stanleys-andrew-slimmon-shares-stock-picks-a-good-year-for-equities.html\"><em>Morgan Stanley’s Slimmon names 3 stocks to buy right now: ‘It’s going to be a good year for equities’</em></a></li><li><a href=\"https://www.cnbc.com/2024/02/16/you-wont-believe-the-bank-thats-offering-one-of-the-highest-cd-rates.html\"><em>This little-known bank is offering one of the highest CD rates</em></a></li></ul>',	'2024-02-26 16:00:23.031',	NULL,	'https://image.cnbcfm.com/api/v1/image/107278484-1690547920631-gettyimages-1564226733-haywardphoto259752_ihmeasjy_v2grkwli.jpeg?v=1708548518&w=929&h=523&vtcrop=y',	'US',	'Economic boost from Taylor Swift’s Eras Tour could be overstated, Nomura warns'),
(8,	'',	'Palestinian Prime Minister Shtayyeh resigns as pressure grows over post-war Gaza plans ',	'<p>Palestinian Prime Minister Mohammad Shtayyeh announced his resignation on Monday, as the Palestinian Authority looks to build support for an expanded role following Israel’s war against the Islamist group Hamas in Gaza.</p><p>The move comes amid growing U.S. pressure on President Mahmoud Abbas to shake up the Authority as international efforts intensify to stop the fighting in Gaza and begin work on a political structure to govern the enclave after the war.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Shtayyeh’s resignation must still be accepted by Abbas, who may ask him to stay on as caretaker until a permanent replacement is appointed.</p><p>The Palestinian Authority, created around 30 years ago as part of the interim Oslo peace accords, has been badly undermined by accusations of ineffectiveness and corruption and the prime minister holds little effective power.</p><p>But Shtayyeh’s departure marks a symbolic shift that underlines Abbas’ determination to ensure the Authority maintains its claim to leadership as international pressure grows for a revival of efforts to create a Palestinian state alongside Israel.</p><p>In a statement to cabinet, Shtayyeh, an academic economist who took office in 2019, said the next administration would need to take account of the emerging reality in Gaza, which has been laid waste by nearly five months of heavy fighting.</p><p>He said the next stage would “require new governmental and political arrangements that take into account the emerging reality in the Gaza Strip, the national unity talks, and the urgent need for an inter-Palestinian consensus.”</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>In addition, it would require “the extension of the Authority’s authority over the entire land, Palestine.”</p><p>No successor has been appointed but Abbas is widely expected to name Mohammad Mustafa, a former World Bank official who is chairman of the Palestine Investment Fund with experience of rebuilding Gaza after a previous war in 2014. There has been no word on elections, which have not been held since 2006.</p><p>The Palestinian Authority exercises limited governance over parts of the occupied West Bank but lost power in Gaza following a factional struggle with Hamas in 2007.</p><p>It has been badly weakened over the years and surveys show it is deeply unpopular among Palestinians. But it remains the only leadership body generally recognized by the international community.</p><p>Palestinian leaders say its ability to exercise effective governance has been effectively blocked by Israeli restrictions, which have included withholding tax revenues due under the Oslo accords. For months, the Authority has been unable to pay full public sector salaries because of a row over the refusal by the Israeli finance ministry to release part of the funds.</p><p>Israel has long accused the Authority of supporting terrorism by offering financial support to the families of militants killed by Israeli forces and allowing antisemitic material to be included in school textbooks.</p><p>Israel has also attacked Palestinian leaders, including Abbas, for not condemning the Hamas-led attack on Israel on Oct. 7.</p><p>Fatah, the faction that controls the Authority, and Hamas, designated as a terrorist organization by the United States and the European Union, have made efforts to bridge their differences and reach an agreement over a unity government and are due to meet in Moscow on Wednesday. A senior Hamas official said the move had to be followed by a broader agreement on governance for the Palestinians.</p><p>“The resignation of Shtayyeh’s government only makes sense if it comes within the context of national consensus on arrangements for the next phase,” senior Hamas official Sami Abu Zuhri told Reuters.</p><p>Israel has vowed to destroy Hamas and says that for security reasons, it will not accept Palestinian Authority rule over Gaza after the war, which broke out following the Hamas-led attack on southern Israel on Oct. 7, which killed some 1,200 Israelis and foreigners, according to Israeli tallies.</p><p>So far, almost 30,000 Palestinians have been killed in the Gaza fighting, according to Palestinian health authorities, and almost the entire population have been driven from their homes.</p>',	'2024-02-26 16:00:23.033',	NULL,	'https://image.cnbcfm.com/api/v1/image/107365607-1706532113411-gettyimages-1960378664-AFP_34H43HA.jpeg?v=1706532347&w=929&h=523&vtcrop=y',	'US',	'Palestinian Prime Minister Shtayyeh resigns as pressure grows over post-war Gaza plans '),
(9,	'',	'Google expects its more advanced large language models to arrive on Android phones next year',	'<p><span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-1\"><a href=\"/quotes/GOOGL/\">Google</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> is bullish on the prospect of its more advanced artificial intelligence models coming to smartphones in the next year.&nbsp;&nbsp;</p><p>The internet giant expects that its currently available Gemini large language model (LLM), which competes with Microsoft-backed OpenAI’s most powerful GPT-4 AI model, will begin to get embedded into devices starting next year.&nbsp;&nbsp;</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Google already offers Gemini Nano, which is the company’s most efficient model for “on-device” AI, across its Pixel devices and on all other capable Android devices.&nbsp;</p><p>Brian Rakowski, vice president of product management for Google’s Pixel unit, said that he expects the company’s most advanced large language models, which are currently only accessible via remote data centers via an internet connection, to begin arriving on smartphones directly next year.&nbsp;</p><p>“There are smaller versions of our Gemini model on the cloud,” Rakowski told CNBC. “There’s been quite a few breakthroughs to compress these models to get them to run on device.”&nbsp;</p><p>“Some have already been proven and some are being explored for some applications. It’d be great having all models on device. It still has wondrous applications.”&nbsp;</p><p>“Gemini Nano is performing at a level that our online models were at less than one year ago,” Rakowski added. “You can do a lot with these distilled small versions of the models on device.”&nbsp;</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>“If you just follow that trajectory, some of that stuff we thought we would have had to go to the cloud for next year will be on device, which is pretty exciting, which is instantaneous without requiring a connection or subscription.”&nbsp;</p><p>Large language models, or LLMs, are AI models capable of understanding and generating language in a humanlike way. Gemini Ultra is Google’s top LLM, clocking in at a whopping 1.56 trillion parameters. For comparison, OpenAI’s GPT-4 consists of 1.76 trillion parameters.&nbsp;</p><br /><p>Smartphone makers have been dreaming of a “supercycle” in their industry, driven by artificial intelligence, after a bruising few years that saw device sales slow aggressively. <a href=\"https://www.idc.com/getdoc.jsp?containerId=prUS51430223#:~:text=Despite%20improved%20expectations%20for%204Q23,forecast%20earlier%20in%20the%20year.\" target=\"_blank\">In 2023, smartphone sales fell to 1.16 billion units</a>, the lowest point for unit shipments in a decade.&nbsp;&nbsp;</p><p>Analysts say a supercycle is unlikely to occur within the next few years as there’s not enough going on in the market in terms of novel features and innovation that will convince people holding their aging smartphones to upgrade.&nbsp;</p><p>“Unfortunately, we don’t expect that boom,” Francisco Jeronimo, vice president of data and analytics at research firm IDC, told CNBC.&nbsp;</p><p>“The last supercycle we saw was between 2010 and 2015, where in five years the market grew five times from around 300 million smartphones per year to 1.5 billion.”&nbsp;</p><p>Nonetheless, more and more smartphone makers are making big investments in AI in the hope that it will drive some more excitement around mobile technology.&nbsp;</p><p>The likes of Humane, Rabbit, and China’s Meizu are betting on a future for smartphones that doesn’t even look like a traditional smartphone. These are devices that would be smaller and more compact, and that we could interact with via voice activation, like an Amazon Echo speaker but on the go.&nbsp;</p><p>Google has been making huge bets on AI in an effort to gain an edge over its rivals like OpenAI, the Microsoft-backed company behind ChatGPT.</p><br /><p>Google recently announced a major rebrand of Bard, its ChatGPT alternative, including a fresh app and subscription options. Bard was renamed Gemini, the same name as the suite of AI models that power the chatbot.</p><p>Android users can download a dedicated Android app for Gemini, while iPhone users can use Gemini in the Google app on iOS.</p><p>Alphabet CEO Sundar Pichai highlighted the firm’s commitment to AI during the company’s Jan. 30 earnings call. Pichai said he eventually wants to offer an AI agent that can complete more and more tasks on a user’s behalf, including within Google Search, although he said there is “a lot of execution ahead.”</p><p>Likewise, chief executives at tech giants from Microsoft to Amazon have underlined their commitment to building AI agents as productivity tools.&nbsp;</p>',	'2024-02-26 16:00:23.037',	NULL,	'https://image.cnbcfm.com/api/v1/image/107374413-1708024437471-gettyimages-1992338676-AA_10022024_1525083.jpeg?v=1708024486&w=929&h=523&vtcrop=y',	'US',	'Google expects its more advanced large language models to arrive on Android phones next year'),
(10,	'',	'British banker Jacob Rothschild dies aged 87',	'<p>British financier Jacob Rothschild, a senior member of one of Europe’s best-known banking dynasties, has died at the age of 87, his family announced on Monday. </p><p>The family, in a statement to the UK’s Press Association news agency, called Rothschild “a towering presence in many peoples’ lives”. </p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>He was “a superbly accomplished financier, a champion of the arts and culture, a devoted public servant, a passionate supporter of charitable causes in Israel and Jewish culture, a keen environmentalist and much-loved friend, father and grandfather,” the family said. </p><p>Rothschild, born in England in 1936, started his career at the family bank, NM Rothschild &amp; Sons, in 1963 before going on to co-found J Rothschild Assurance Group, which became today’s London-based wealth manager St James’s Place. </p><p>He was involved in many business endeavours, including founding investment trust RIT Capital Partners, which has backed a variety of companies, from hedge funds to clean technology start-ups. </p><p>Rothschild was also known for being a long-standing patron of the arts, and was trustee of Britain’s National Gallery between 1985 and 1991. </p><p>Ed Vaizey, Britain’s former culture minister, paid tribute to Rothschild on X, describing him as one of the country’s greatest cultural philanthropists. </p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Waddesdon Manor, an English country estate managed by the Rothschild Foundation, said on social media platform X that it and the foundation were “deeply saddened” by the death, calling Rothschild a “businessman, entrepreneur, philanthropist and cultural leader”. </p><p>The Rothschild banking family traces its roots back to 18th century Frankfurt, from where different family members moved to cities across Europe to build out banking businesses.</p>',	'2024-02-26 16:00:23.040',	NULL,	'https://image.cnbcfm.com/api/v1/image/107378162-1708952396686-gettyimages-57116581-57097658DMB006_Epoque.jpeg?v=1708952480&w=929&h=523&vtcrop=y',	'US',	'British banker Jacob Rothschild dies aged 87');
